import img19 from '../Images/img19.png';
import img20 from '../Images/img20.jpeg';
import img21 from '../Images/img21.jpeg';
import yourSong from "../Images/song.mp3"; 

import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import AttachFileIcon from '@material-ui/icons/AttachFile';

const Landing = () => {
    const audioRef = useRef(null);

  const playMusic = () => {
    if (audioRef.current) {
      audioRef.current.play();
    }
  };

  const toggleMusic = () => {
    if (audioRef.current) {
      if (audioRef.current.paused) {
        audioRef.current.play();
      } else {
        audioRef.current.pause();
      }
    }
  };

    return (
    <Container>
        <audio
        ref={audioRef}
        src={yourSong}
        loop={true} // Loop the song
        controls={false} // Hide controls
      />

        <button className="colorme" onClick={toggleMusic}>❤️</button>
        <h2>Exactly four months ago, I visited the Pattern Drive office for the first time, purely out of fun, and it turned out to be one of the best decisions of my life.</h2>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img1} alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya 😘</div>
        </div>
        <h2>Haan dosto ke samne rizz smash kar diya tha 2 sec mai room se bahar nikal ke but koi na cute mila tha ek. Uss din first time tera woo mera pasand wala smile dikha tha aur woo pyara sa eyes pe eyeliner.</h2>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img2} alt="" />
            <div className="desc">"Can I ask you few questions?"</div>
        </div>
        <h2>South city gaya dosto ke sath, naam pucha woo ladki ka naam kya tha - Priya bola woo log. Kisiko bhi tera account nhi mila, fir maine raat ko account dhunda from linkedin 😂</h2>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img3} alt="" />
            {/* <img src={img19} alt="" /> */}
            <div className="desc">First pic I saw of yours ❤️</div>
        </div>
        <h2>Pata laga itna sundar naam hai tera - Riya ❤️ - Insta profile mila exactly 01:01 ko raat ko, aur 3 mins mai gayab lol!</h2>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img4} alt="" />
            <div className="desc">Kya angel time pe account mila ❤️</div>
        </div>
        <h2>Ab smjh nhi aa raha itni jaldi meri itni pyari ladki ke sath 4 month kaise beet gaya 🥺🥹💓</h2>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://p.turbosquid.com/ts-thumb/CN/SRkbHS/RAnFNuDc/3/jpg/1561979704/1920x1080/fit_q87/5a3574158fbadaae10dcd6386f63945ecc42fcbf/3.jpg" alt="" />
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://png.pngtree.com/png-vector/20240325/ourmid/pngtree-angry-dog-sports-player-png-image_12198198.png" alt="" />
            <div className="desc">Bhow-Bhow Bhowmik</div>
        </div>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img5} alt="" />
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img6} alt="" />
        </div>
        <div className="image">
