        </div>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img13} alt="" />
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img14} alt="" />
        </div>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img15} alt="" />
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img16} alt="" />
        </div>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img17} alt="" />
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img18} alt="" />
        </div>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img20} alt="" />
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img21} alt="" />
        </div>
        <h2 className="colorme">I love you so much meri jaan ❣️</h2>
    </Container>
  )
}

export default Landing

const Container = styled.div`
