        background-color: white;

        padding: 10px 10px 10px 10px;
        transform: rotate(2deg);

        .top-holder{
            position: absolute;
            /* width: 100%; */

            svg{
                font-size: 2.5rem;
                fill: black;
            }

            text-align: center;
            top: -20px;
            left: -10px;
            transform: rotate(40deg);
        }

        img{
            width: 100%;
        }

        .desc{
            font-size: 0.8rem;
        }
    }

    .oppo{
        transform: rotate(-2deg);   
    }

    .colorme{
        font-size: 1.5rem;
        color: #c4d1b0;
    }

    button{
        font-size: 1.5rem;
